1612	Jornada sobre el Software Libre de Geomática y SIG aplicado a Educación e Investigación 	37859592059	671743501	2017-09-18 15:53:00-03:00	Cristina	Massera	cristinamassera@gmail.com	1	Confirmar asistencia	Pedido gratuito	0	0	0	Acreditado	Comodoro Rivadavia, Chubut, Argentina	\N	\N	13925995	Universidad Nacional de la Patagonia San Juan Bosco	El objetivo general del Laboratorio de SIG y T de la UNPSJB, es generar y promover iniciativas de investigación, extensión y vinculación tecnológica sobre las problemáticas territoriales de y desde la región patagónica. Se busca favorecer el trabajo científico interinstitucional de carácter transdisciplinar; la formación de recurso humano; el desarrollo de una política de publicaciones; jornadas de discusión que fomenten la discusión crítica sobre problemáticas locales; interacción y asesoramiento a instituciones locales, provinciales y nacionales; y la planificación de actividades de extensión, divulgación y transferencia en el entorno local, provincial y regional, integrando la información en una base de datos geoespacial que permita hacer visible los datos básicos y temáticos.La Facultad de Humanidades y Ciencias Sociales, pone en marcha este proyecto con el objetivo de sistematizar la información.VisiónContribuir en materia de Ciencias Sociales y Humanidades a que la UNPSJB, con las sedes Comodoro Rivadavia, Esquel, Trelew y Puerto Madryn,  intervenga en problemáticas relevantes desde ejes transdisciplinarios de investigación, transferencia y extensión.MisiónConstituir un espacio de articulación institucional conformado por profesionales de distintas disciplinas que promuevan líneas de investigación, transferencia científica y extensión universitaria para reconocer las más importantes tendencias de desarrollo de las tecnologías geoespaciales y áreas científicas involucradas junto a la capacidad de adaptarse a los múltiples condicionantes de naturaleza profesional, logística, institucional y legal.	\N	\N	\N	\N	\N	\N	\N	\N	\